var title_f34_49_35614="Light chain amyloidosis survival by NT-proBNP response";
var content_f34_49_35614=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F86505&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F86505&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 552px\">",
"   <div class=\"ttl\">",
"    Survival curves for patients with systemic light chain amyloidosis stratified by NT-proBNP response or progression at six months",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 532px; height: 398px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the international series of 816 patients from seven centers, staging cardiac biomarkers were available for 53 percent (432/816). Of these, 24 percent were stage 1 (both NT-proBNP p &le;332 ng/L and cardiac troponin T (cTnT) p &le;0.035 ng/mL or cTnI p &le;0.1 ng/mL), 52 percent stage 2 (NT-proBNP &gt;332 ng/L or cTnT &gt;0.035 ng/mL or cTnI &gt;0.1 ng/mL), and 24 percent stage 3 (both NT-proBNP &gt;332 ng/L and cTnT &gt;0.035 ng/mL or cTnI &gt;0.1 ng/mL). In these survival curves, results for 377 patients with baseline NT-proBNP greater than or equal to 650 ng/L are shown according to NT-proBNP response or progression at six months.",
"    <sup>",
"     [1]",
"    </sup>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Palladini G, Dispenzieri A, Gertz MA, et al. Validation of the criteria of response to treatment in AL amyloidosis. Blood 2010; 116:1364a.",
"       </li>",
"      </ol>",
"      Reprinted by permission from Macmillan Publishers Ltd: Leukemia, Comenzo RL, Reece D, Palladini G, Consensus guidelines for the conduct and reporting of clinical trials in systemic light-chain amyloidosis, advance online publication, 15 May 2012 (DOI: 10.1038/leu.2012.100). Copyright &copy; 2012.",
"      <a href=\"file://www.nature.com/leu/index.html\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"       file://www.nature.com/leu/index.html",
"      </a>",
"      .",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
