var title_f34_49_35615="Hormone resp hypophosphatemia";
var content_f34_49_35615=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F51724&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F51724&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 508px\">",
"   <div class=\"ttl\">",
"    Hormonal response to hypophosphatemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 488px; height: 199px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Physiologic sequence of events following the stimulation of calcitriol formation by hypophosphatemia. The net effect is an increase in the plasma phosphate concentration with only a slight increase in the plasma calcium concentration. Both the latter change and the direct inhibitory effect of calcitriol contribute to the decline in PTH release in this setting.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from DeLuca, H, Am J Med 1975; 58:39.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
